(1, 89, 'Beberapa software web design yang sering dipakai antara lain', 'Microsoft Frontpage, Macromedia Fireworks, Mysql', 'Microsoft Frontpage, Macromedia Fireworks, Php', 'Macromedia Dreamweaver, Adobe ImageReady, ASP', 'Macromedia Dreamweaver, Adobe ImageReady, Corel Draw', 'Macromedia Dreamweaver, Microsoft Frontpage, Macromedia Fireworks.', 5, 0),
(2, 89, 'Fungsi dari tag HTML &lt;head&gt;&lt;/head&gt; adalah', 'Mendefinisikan judul yang hendak ditampilkan pada browser', 'Mendefinisikan bahwa teks yang berada diantara kedua tag tersebut adalah file HTML', 'Mendefinisikan head dalam sebuah file HTML.', 'Mendefinisikan teks yang hendak ditampilkan sebagai isi halaman web', 'Mendefinisikan &lt;&gt; dalam sebuah file HTML.', 3, 1),
(3, 89, 'Tag HTML yang berfungsi untuk mendefinisikan teks yang hendak ditampilkan sebagai isi halaman web adalah', '&lt;html&gt;&lt;/html&gt;', '&lt;head&gt;&lt;/head&gt;', '&lt;title&gt;&lt;/title&gt;', '&lt;body&gt;&lt;/body&gt;', '&lt;h1&gt;&lt;/h1&gt;', 4, 2),
